import React, { Component } from "react";
import Calendar from "react-calendar";

class cal extends Component {
  onChange = (date) => this.setState({ date });

  render() {
    return (
      <div>
        <Calendar onChange={this.onChange} value={this.state.date} />
      </div>
    );
  }
}

export default cal;
